import React from 'react';
import './App.jsx';

import ComParametro from './components/ComParametro';
import Card from './components/layout/Card';


export default (props) => (
    <div clasName="App">

        <Card titulo='#03 - Componente Com Parametro'>
            <ComParametro titulo='Boeing 737-700' subtitulo='Esse é o subtítulo' imagem="https://upload.wikimedia.org/wikipedia/commons/thumb/9/9d/MASP_Brazil.jpg/1200px-MASP_Brazil.jpg" loc='https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d1828.5990460268927!2d-46.65561904351654!3d-23.561327949007406!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0xe904f6a669744da1!2sMuseum%20of%20Art%20of%20S%C3%A3o%20Paulo%20Assis%20Chateaubriand!5e0!3m2!1sen!2sbr!4v1630033573868!5m2!1sen!2sbr' video="https://www.youtube.com/embed/f02mOEt11OQ"/>
        </Card>
        
    </div>
)
